import logo from './foreverdao-400x400.jpg';
import './App.css';

import { Button } from '@material-ui/core';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          ForeverDAO Button
        </h1>
      </header>
      <span>START<Button color="primary">Hello World</Button>END</span>
    </div>
  );
}

export default App;
